                    <Ficha i={logo[2]} alt={name[2]} />
                  </div>
                  <div className={styles.colm4}>
                    <Ficha i={logo[3]} alt={name[3]} />
                  </div>
                </div>

                <div className={styles.i4}>
                  <div className={styles.colm4}>
                    <Ficha i={logo[4]} alt={name[4]} />
                  </div>
                  <div className={styles.colm4}>
                    <Ficha i={logo[5]} alt={name[5]} />
                  </div>
                  <div className={styles.colm4}>
                    <Ficha i={logo[6]} alt={name[6]} />
                  </div>
                  <div className={styles.colm4}>
                    <Ficha i={logo[7]} alt={name[7]} />
                  </div>
                </div>
              </Fragment>
            ) : (
              'cargando'
            )}
          </div>
        </div>
      </div>
    </div>
  )
}
